define('config',
    ['app', 'mock/mock', 'knockout', 'amplify'],
    function (app, mock, ko, amplify) {
        var
            viewIds = {
                propertymetasettings: '#propertymetasettings-view',
                starsenseConfigurations: '#starsenseconfigurations-view',
                excelAssetUpload: '#excelupload-view',
                faultCategories: '#fault-categories-view',
                jobCategories: '#job-categories-view',
                dataTypeSettings: '#data-type-settings-view',
                localizedCatalogs: '#localizedcatalogs-view',
                jobconfiguration: '#job-configuration-view',
                assetsummarysettings: '#asset-summary-settings-view',
                propertyeditorsettings: '#property-editor-settings-view',
                energycost: '#energy-cost-settings-view',
                customlogoupload: '#custom-logo-upload-settings-view',
            },

            _useMocks = false, // Set this to toggle mocks
            useMocks = function(val) {
                if (val) {
                    _useMocks = val;
                    init();
                }
                return _useMocks;
            },
            
            dataserviceInit = function () { },

            configureAmplifyDefaultDecoder = function() {
                // overwrites the default request decoder so we have control over callback handlers and their parameters
                amplify.request.decoders._default = function (data, status, xhr, success, error) {
                    if (xhr.status >= 200 && xhr.status < 300) {
                        success(data);
                    }
                    else if (xhr.status === 401 || xhr.status === 403) {
                        var res = JSON.parse(xhr.responseText);
                        if (res && res.message && res.message.indexOf('expired') !== -1) {
                            window.location = app.rootUrl + '/account/sessionexpired';
                        } else {
                            window.location = app.rootUrl + '/account/accessdenied';
                        }
                    }
                    else {
                        var message = "";
                        if (xhr.responseText) {
                            var response = JSON.parse(xhr.responseText);
                            message = response.message;
                        }
                        message = message ? message : xhr.statusText;
                        error(message);
                    }
                };

                // attach an anti-forgery token to every POST request
                var aftoken = $('input[name="__XAntiForgeryToken__"]').val();
                amplify.subscribe('request.ajax.preprocess', function (defnSettings, settings, ajaxSettings, ampXhr) {
                    if (defnSettings.type === 'POST' || defnSettings.type === 'DELETE' || defnSettings.type === 'PUT') {
                        defnSettings.beforeSend = function(xhr) {
                            xhr.setRequestHeader("X-Anti-Forgery-Token", aftoken);
                            // return true to make decoder fire
                            return true;
                        };
                    }
                });
            },
            
            init = function () {
                configureAmplifyDefaultDecoder();
                
                if (_useMocks) {
                    dataserviceInit = mock.dataserviceInit;
                }
                dataserviceInit();
            };

        init();

        return {
            viewIds: viewIds,
            dataserviceInit: dataserviceInit,
            useMocks: useMocks
        };
    });

