define('eventbroker', ["amplify"], function (amplify) {
    var
        eventIds = {
            addStarsenseConfigurationsToCatalogDialogClosed: "addStarsenseConfigurationsToCatalogDialogClosed",
            excelUploadWarningDialogClosed: "excelUploadWarningDialogClosed",
            excelColumnMappingChanged: "excelColumnMappingChanged"
        },

        publish = function (eventId) {
            amplify.publish.apply(eventId, arguments);
        },

        subscribe = function (eventId, callback) {
            amplify.subscribe(eventId, callback);
        },

        unsubscribe = function (eventId, callback) {
            amplify.unsubscribe(eventId, callback);
        };
    
    return {
        eventIds: eventIds,
        publish: publish,
        subscribe: subscribe,
        unsubscribe: unsubscribe
    };
});
