/// <summary>
/// The activity module displays an activity indicator inside of a DOM element with the id 'activityIndicator'.
/// </summary>

define('activity', [],function() {

  var Activity = function () {
    var $activity = $('#activity-indicator');
    var hidden = false;

    var show = function() {
      $activity.show();
      hidden = false;
    };

    var hide = function() {
      $activity.hide();
      hidden = true;
    };

    var isHidden = function() {
      return hidden;
    };

    $activity.hide();

    return {
      show: show,
      hide: hide,
      isHidden: isHidden
    };
  }

  return new Activity();

});
define('vm.propertymetasettings',
    ['jquery', 'knockout', 'eventbroker', 'underscore', 'dataservice', 'model.mapper', 'activity', 'notifier'],
    function ($, ko, eventBroker, _, dataservice, mapper, activity, notifier) {
        

        return function () {
            var isLoading = false,
                selectedCategory = ko.observable(),
                properties = ko.observableArray(), // property meta short descriptions
                selectedProperty = ko.observable(); // property meta details

            var canEdit = ko.computed(function() {
                return selectedProperty();
            });

            var canToggleSettings = ko.computed(function() {
                return selectedProperty() && selectedProperty().isEnabled();
            });

            var isValid = ko.computed(function() {
                return canEdit() ? selectedProperty().validationModel.isValid() : true;
            });

            var highlightSelection = function(propertyBrief) {
                _.each(properties(), function(element) { element.isSelected(false); });
                if (propertyBrief) {
                    propertyBrief.isSelected(true);
                }
            };

            var detailsDirty = function() {
                return selectedProperty() && selectedProperty().dirtyFlag().isDirty();
            };

            var confirmDiscardChanges = function(onYes, onNo) {
                if (detailsDirty()) {
                    notifier.showCustomConfirm({
                        title: 'Discard unsaved changes?',
                        message: 'You have unsaved changes. Do you want to continue without saving?',
                        onYes: function () {
                            selectedProperty().dirtyFlag().reset();
                            onYes();
                        },
                        onNo: onNo
                    });
                } else {
                    onYes();
                }
            };

            var selectProperty = function(propertyBrief) {
                if (isLoading) return;

                confirmDiscardChanges(function () {
                    notifier.clear();
                    activity.show();

                    dataservice.PropertyMetaSettings.getPropertyDetails({
                        success: function (json) {
                            var property = mapper.propertyMetaDetail.fromDto(json);
                            selectedProperty(property);
                            highlightSelection(propertyBrief);
                            activity.hide();
                        },
                        error: function (msg) {
                            activity.hide();
                            notifier.showError(msg);
                        }
                    }, propertyBrief.propertyMetaId);
                });
            };

            var saveCmd = ko.asyncCommand({
                execute: function(complete) {
                    var payload = ko.toJS(selectedProperty().toPostModel());
                    dataservice.PropertyMetaSettings.postPropertyDetails({
                        success: function(data) {
                            complete();
                            updateOverviewWithChanges();
                            selectedProperty().dirtyFlag().reset();
                            notifier.showSuccess("Successfully saved!");
                        },
                        error: function(msg) {
                            notifier.showError(msg);
                            complete();
                        }
                    }, payload);
                },
                canExecute: function () {
                    // TODO CD: Eric why do check for validity here? Causes problemes with number values. (save button stays disabled)
                    //return isValid() && detailsDirty();
                    return detailsDirty();
                }
            });

            var getPropertiesOfCategory = function(callbacks, categoryKey) {
                activity.show();
                dataservice.PropertyMetaSettings.getPropertiesOfCategory({
                    success: function(data) {
                        var props = _.map(data, function(value) {
                            return mapper.propertyMetaBrief.fromDto(value);
                        });
                        activity.hide();
                        callbacks.success(props);
                    },
                    error: function(msg) {
                        activity.hide();
                        notifier.showError(msg);
                    }
                }, categoryKey);
            };

            var previousCategorySelection = null;
            var onCategorySelectionChanged = function(newValue) {
                // in case of selection undo, we don't want to update our view
                if (previousCategorySelection === newValue) return;

                // undo the category selection if the user cancels
                confirmDiscardChanges(
                    function () {       // confirm
                        previousCategorySelection = newValue;

                        $("#propertyOverview").scrollTop(0);

                        isLoading = true;
                        getPropertiesOfCategory({
                            success: function (props) {
                                isLoading = false;
                                properties(props);
                                selectProperty(properties()[0]);
                            },
                            error: function (msg) {
                                isLoading = false;
                                notifier.showError(msg);
                            }
                        }, newValue);
                    },
                    function () {       // cancel
                        selectedCategory(previousCategorySelection);
                    }
                );
            };

            var updateOverviewWithChanges = function() {
                var prop = _.findWhere(properties(), { propertyMetaId: selectedProperty().propertyMetaId });
                if (prop) {
                    prop.isEnabled(selectedProperty().isEnabled());
                    prop.customName(selectedProperty().customName());
                    prop.customCategory(selectedProperty().customCategory());
                    prop.isCatalog(selectedProperty().useCatalog());
                }
            };

            var init = function() {
                selectedCategory.subscribe(onCategorySelectionChanged);
            };

            var getScrollBarWidth = function () {
                var $outer = $('<div>').css({ visibility: 'hidden', width: 100, overflow: 'scroll' }).appendTo('body'),
                    widthWithScroll = $('<div>').css({ width: '100%' }).appendTo($outer).outerWidth();
                $outer.remove();
                return 100 - widthWithScroll;
            };

            init();

            return {
                selectedCategory: selectedCategory,
                properties: properties,
                selectedProperty: selectedProperty,
                selectProperty: selectProperty,
                canToggleSettings: canToggleSettings,
                canEdit: canEdit,
                saveCmd: saveCmd,
                detailsDirty: detailsDirty,
                getScrollBarWidth: getScrollBarWidth
            };
        };
    });
define('vm.starsenseconfigurationdialog',
	['jquery', 'knockout', 'app', 'eventbroker', 'underscore', 'dataservice', 'model', 'model.mapper', 'activity', 'notifier'],
	function($, ko, app, eventBroker, _, dataservice, model, mapper, activity, notifier) {
	    return function () {
	        var starsenseConfigurationDtos,
	            starsenseConfigurations = ko.observableArray(),
	            searchText = ko.observable(),
                delayedSearchText,
	            busy = ko.observable(false),
	            selectedItemCount = ko.observable(0);

	        // refreshes the observable starsense configuration collection using either the supplied list,
	        // or the data received from the server
	        var refreshStarsenseConfigurations = function (items) {
	            items = items || starsenseConfigurationDtos;
	            var shorts = _.map(items, function (item) {
	                return mapper.unassignedStarsenseConfigurationShort.fromDto(item);
	            });
	            starsenseConfigurations(shorts);
	        };

	        // Closes the modal dialog and removes it from the DOM
	        var close = ko.command({
	            execute: function() {
	                // TODO alert when multiple selection active to prevent accidental close
	                eventBroker.publish(eventBroker.eventIds.addStarsenseConfigurationsToCatalogDialogClosed);
	            },
	            canExecute: function() {
	                return !busy();
	            }
	        });

	        var clearSelectedItems = function () {
	            _.each(starsenseConfigurations(), function (element) { element.isSelected(false); });
	            selectedItemCount(0);
	        };

	        var selectItem = function (item) {
	            item.isSelected(!item.isSelected());
	            selectedItemCount(selectedItemCount() + (item.isSelected() ? 1 : -1));
	        };

	        var filterStarsenseConfigurations = function () {
	            var hasSearchText = !$.isNullOrWhiteSpace(searchText());
	            var filteredShorts = hasSearchText
	                ? _.filter(starsenseConfigurationDtos, function (item) { return item.name.toLowerCase().indexOf(searchText().toLowerCase()) !== -1; })
	                : null;
	            refreshStarsenseConfigurations(filteredShorts || starsenseConfigurationDtos);
	        };

	        // posts the selected starsense configuration to be added
	        var addSelection = ko.asyncCommand({
	            execute: function (complete) {
	                var idsToAdd = _.chain(starsenseConfigurations())
	                    .filter(function(item) { return item.isSelected(); })
	                    .map(function(item) { return item.externalId(); })
	                    .value();

	                dataservice.StarsenseConfigurations.postAddStarsenseConfigurations(idsToAdd)
	                    .then(function() {
	                        notifier.showSuccess($.formatString('Added {0} starsense configuration(s).', idsToAdd.length));
	                        clearSelectedItems();
	                        complete();
	                        requestStarsenseConfigurationsNotInSite();
	                    })
	                    .fail(function(msg) {
	                        notifier.showError(msg);
	                        complete();
	                    });
	            },
	            canExecute: function() {
	                return !busy() && selectedItemCount() > 0;
	            }
	        });

	        var requestStarsenseConfigurationsNotInSite = function () {
	            busy(true);
	            activity.show();

	            dataservice.StarsenseConfigurations.getStarsenseConfigurationsNotInSite()
	                .then(function(data) {
	                    starsenseConfigurationDtos = data; // save for later use when filtering
	                    if (!delayedSearchText)
	                        createDelayedSearchTextHandler();
	                    filterStarsenseConfigurations();
	                })
	                .fail(notifier.showError)
	                .always(function() {
	                    activity.hide();
	                    busy(false);
	                });
	        };

	        var createDelayedSearchTextHandler = function () {
	            var configuration = app.getConfiguration();
                if (configuration.inputThrottleDelay > 0) {
                    delayedSearchText = ko.computed(function() { return searchText(); }).extend({
                        rateLimit: { method: "notifyWhenChangesStop", timeout: configuration.inputThrottleDelay }
                    }).subscribe(function() {
                        filterStarsenseConfigurations();
                    });
                } else {
                    searchText.subscribe(function() {
                        filterStarsenseConfigurations();
                    });
                }
	        };

	        var init = function () {
	            requestStarsenseConfigurationsNotInSite();
	        };

	        init();

	        return {
	            starsenseConfigurations: starsenseConfigurations,
	            searchText: searchText,
	            selectItem: selectItem,
	            close: close,
	            addSelection: addSelection,
	            busy: busy
	        };
		};
	});
