define('vm.jobconfiguration',
    ['jquery', 'knockout', 'eventbroker', 'underscore', 'dataservice', 'model.mapper', 'activity', 'notifier'],
    function ($, ko, eventBroker, _, dataservice, mapper, activity, notifier) {
        

        return function () {
            var uploadedFileName = ko.observable(null),
                busy = ko.observable(false),
                hasFileSelection = ko.observable(false),
                isUploading = ko.observable(false),
                isJobStatusAutoChanged = ko.observable(false);

            var init = function () {
                dataservice.JobConfiguration.getJobStatusConvertFlag()
                    .done(function (data) {
                        isJobStatusAutoChanged(data);
                    });
            };

            var beginUploadConfiguration = function () {
                setBusy(true);
                var myform = $("#multiform");
                var action = myform.attr('action');
                var method = myform.attr('method');

                if (window.FormData !== undefined) {

                    var parameters = myform.serializeArray();
                    var formData = new FormData();

                    $.each(parameters, function (i, param) {
                        formData.append(param.name, param.value);
                    });

                    var fileData = $("#uploadFile").prop("files")[0];
                    formData.append('FileUpload', fileData);

                    $.ajax({
                        url: action,

                        cache: false,
                        contentType: false,
                        processData: false,
                        data: formData,
                        type: method,
                        mimeType: "multipart/form-data",

                        success: function (data) {
                            notifier.showSuccess('Successfully uploaded job configuration.');
                            myform[0].reset();
                            setBackToInitialState();
                        },
                        error: function (jqXHR, textStatus, errorThrown) {
                            setBusy(false);
                            var error = jQuery.parseJSON(jqXHR.responseText);
                            notifier.showError(error.message);
                            myform[0].reset();
                            setBackToInitialState();
                        }
                    });
                } else {
                    var formObj = $(myform);

                    var iframeId = 'unique' + (new Date().getTime());
                    var iframe = $('<iframe src="javascript:false;" name="' + iframeId + '" />');
                    iframe.hide();

                    formObj.attr('target', iframeId);

                    iframe.appendTo('body');
                    var data;
                    iframe.load(function (e) {
                        var doc = getDoc(iframe[0]); //get iframe Document
                        var docRoot = doc.body ? doc.body : doc.documentElement;
                        data = docRoot.innerHTML;
                        //data is returned from server.
                    });

                    $("#multiform").submit();
                    notifier.showSuccess('Successfully uploaded job configuration.');
                    myform[0].reset();
                    setBackToInitialState();
                }
            };

            var canStartFileUpload = ko.computed(function () {
                return !isUploading() && hasFileSelection();
            });

            var updateJobStatusFlag = function (item) {
                setBusy(true);
                dataservice.JobConfiguration.updateJobStatusConvertFlag({
                    isJobStatusAutoConvert: item.isJobStatusAutoChanged()
                }).then(function () {
                    notifier.showSuccess('Successfully saved!');
                }).fail(notifier.showError).always(function () {
                    setBusy(false);
                    return false;
                });
                return true;
            };

            var setBackToInitialState = function () {
                setBusy(false);
                hasFileSelection(false);
                uploadedFileName(null);
            };

            var setBusy = function (isBusy) {
                if (isBusy) {
                    activity.show();
                } else {
                    activity.hide();
                }
                busy(isBusy);
            };

            init();

            return {
                uploadedFileName: uploadedFileName,
                beginUploadConfiguration: beginUploadConfiguration,
                hasFileSelection: hasFileSelection,
                busy: busy,
                isUploading: isUploading,
                canStartFileUpload: canStartFileUpload,
                isJobStatusAutoChanged: isJobStatusAutoChanged,
                updateJobStatusFlag: updateJobStatusFlag
            };
        };
    });
