define('scrollerUtil', [],function () {
    var scrollableElement = null;
    var ScrollerUtil = function(scrollContainer, childElement) {

        var w = scrollContainer;
        var row = childElement;
        var getNumberOfVisibleRows = function (parent, rowItem) {
            var numOfRows = Math.floor(parent.height() / rowItem.height());
            return numOfRows;
        };
      
        w.scrollTop(0);
        var maxScrollHeight = w.prop('scrollHeight');
        var numOfVisibleRows = getNumberOfVisibleRows(w, row);
        scrollableElement = { "container": w, "numOfVisibleRows": numOfVisibleRows, "rowHeight": row.height(), "maxScroll": maxScrollHeight };

     
        var getVisibleEndIndex = function () {
            var startIndex = getVisibleStartIndex();

            var endIndex = startIndex + (scrollableElement.numOfVisibleRows - 1);
            if (scrollableElement.container.scrollTop() >= scrollableElement.rowHeight) {
                endIndex--; /* to exclude table header */
            }
            return endIndex;
        }

        var getVisibleStartIndex = function () {
            var startIndex = Math.floor(scrollableElement.container.scrollTop() / scrollableElement.rowHeight);
            return startIndex;
        }

      
        var getRowIntoView = function (selectedRowIndex) {
            var firstVisibleIndex = getVisibleStartIndex();
            var lastVisibleIndex = getVisibleEndIndex();
            if (scrollableElement.container.scrollTop() < scrollableElement.rowHeight) {
                lastVisibleIndex--; /* to exclude table header */
            }
            if (selectedRowIndex < firstVisibleIndex || selectedRowIndex > lastVisibleIndex) {
                var calculatedScrollPositionToSet = scrollableElement.rowHeight * selectedRowIndex;
                scrollableElement.container.scrollTop(calculatedScrollPositionToSet);
            }
        };

        var setBottomScrollPosition = function (selectedRowIndex) {
            var lastVisibleIndex = getVisibleEndIndex() - 1;  /* get the second last index */
            if (scrollableElement.container.scrollTop() < scrollableElement.rowHeight) {
                lastVisibleIndex--; /* to exclude table header */
            }

            if (selectedRowIndex >= lastVisibleIndex) {
                var scrollPositionToSet = scrollableElement.container.scrollTop() + scrollableElement.rowHeight;
                if (scrollPositionToSet > scrollableElement.maxScroll) {
                    scrollPositionToSet = scrollableElement.maxScroll;
                }
                scrollableElement.container.scrollTop(scrollPositionToSet);
            }
        };

        var setTopScrollPosition = function (selectedRowIndex) {
            var firstVisibleIndex = getVisibleStartIndex();

            if (selectedRowIndex <= firstVisibleIndex) {
                var scrollPositionToSet = scrollableElement.container.scrollTop() - scrollableElement.rowHeight;
                if (scrollPositionToSet < scrollableElement.rowHeight) {
                    scrollPositionToSet = 0;
                }
                scrollableElement.container.scrollTop(scrollPositionToSet);
            }

        };
        return {
            getRowIntoView: getRowIntoView,
            setBottomScrollPosition: setBottomScrollPosition,
            setTopScrollPosition: setTopScrollPosition
        };
    };

    return {
        ScrollerUtil: ScrollerUtil,
    };
});
